import React from 'react'
import './Progress.css'
export const Progress = ({
    progress
}) => {
    const Parentdiv = {
        height: 30,
        width: '100%',
        borderRadius: 15,
    }

    const Childdiv = {
        height: '100%',
        width: `${progress}%`,
        backgroundColor: "aqua",
        borderRadius: 40,
        textAlign: 'right',
        alignItems:"center",
        paddingHorizntal:10,
    }

    const progresstext = {
        padding: 5,
        color: 'black',
        fontWeight: 500
    }

    return (
        <div style={Parentdiv}>
            <div style={Childdiv}>
                <p style={progresstext}>{`${progress}%`}</p>
            </div>
        </div>
    )
}
